int dot_product(int a[], int b[], int n) {
	int sum = 0;
	for (int l = 0; l < n; l++) {
		sum += a[l] * b[l] / 255;
	}
	return sum;
}

void softmax(int a[]) {
	return;
}

int normalise(int x, int i) {
	if (i % 6 == 0) {
		return int(255 * (x - (-8414)) / 9961);
	} else if (i % 6 == 1) {
		return int(255 * (x - (-1292)) / 11282);
	} else if (i % 6 == 2) {
		return int(255 * (x - (-5520)) / 8848);
	} else if (i % 6 == 3) {
		return int(255 * (x - (-137)) / 284);
	} else if (i % 6 == 4) {
		return int(255 * (x - (-131)) / 217);
	} else { //i % 6 == 5
		return int(255 * (x - (-73)) / 179);
	}
}

